import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';
import axios from '../../axios-orders';
import withErrorHandler from '../../hoc/withErrorHandler/withErrorHandler';


class Feiras extends Component {
    state = {
        feiras: [],
        loading: true
    }

    
    componentDidMount() {
        console.log(this.state);
        axios.get('/feira')
            .then(res => {
                const fetchedLista = [];
                for (let key in res.data) {
                    fetchedOrders.push({
                        ...res.data[key],
                        id: key
                    });
                }
                this.setState({loading: false, feiras: fetchedLista});
                console.log(this.state);
                console.log(fetchedLista);
            })
            .catch(err => {
                this.setState({loading: false});
            });
        console.log(this.state);
    }

    render () {
        return (
            <div>
                {this.state.feiras.map(feira => (
                    <Feira 
                         key={feira.id}
                        // nome={or}
                        nome={feira.nome} />
                ))}
            </div>
        );
    }
}

export default withErrorHandler(Feiras, axios);
